import axios from 'axios';
const url = 'http://covid19.mathdro.id/api';

export const fetchData = async () =>{
    try {
        const {data: {confirmed, recovered, deaths, last}} = await axios.get(url);
        
        return {confirmed, recovered, deaths, last };
        
    } catch (error) {
        
    }
}
